(32, 1, '2021-03-27 15:50:27', '2021-03-27 15:50:27', '<!-- জাম্বোট্রন এর কাজ শুরু -->\r\n<div class=\"row\">\r\n<div class=\"col\">\r\n<div class=\"jumbotron jumbotron-fluid\">\r\n<div class=\"container\">\r\n<p class=\"lead\">কি চিন্তিত?</p>\r\n\r\n<h1 class=\"display-5\">জিপিএ অনুযায়ী কোন বিশ্ববিদ্যালয়গুলোতে পরীক্ষা দেওয়া যাবে?</h1>\r\n- এটা ভেবে চিন্তিত?\r\n\r\n<hr class=\"my-2\" />\r\n\r\nসমস্যা নেই। সমাধান আছে আমাদের কাছে।\r\n<p class=\"lead text-success\">এখানেই জানতে পারবে, তুমি তোমার জিপিএ এর উপর ভিত্তি করে কোন কোন বিশ্ববিদ্যালয়গুলোতে ভর্তি পরীক্ষা দিতে পারবে।</p>\r\n<p class=\"lead text-success font-weight-bold\">তাই আমাদের এই ওয়েব সাইটে তোমাকে স্বাগতম।</p>\r\n\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- জাম্বোট্রন এর কাজ শেষ -->\r\n<div class=\"container-fluid\"><!-- Start Content area Jumbotron -->\r\n<div class=\"jumbotron jumbotron-fluid text-white bg-dark\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col\">\r\n<h1 class=\"fs-3 text-center mb-4\">- চলুন শুরু করা যাক -</h1>\r\n</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-md-4\"><form action=\"search_result.html\" method=\"POST\">\r\n<div class=\"\"><label class=\"form-label\" for=\"exampleInputEmail1\">এসএসসি জিপিএ</label>\r\n<input id=\"exampleInputEmail1\" class=\"form-control\" type=\"email\" aria-describedby=\"emailHelp\" /></div>\r\n</form></div>\r\n<div class=\"col-md-4\">\r\n<div class=\"\"><label class=\"form-label\" for=\"exampleInputPassword1\">এইচএসসি জিপিএ</label>\r\n<input id=\"exampleInputPassword1\" class=\"form-control\" type=\"password\" /></div>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<div class=\"\"><label class=\"form-label\" for=\"selectdivision\">কোন বিভাগে পরীক্ষা দিতে চান</label>\r\n<select id=\"selectdivision\" class=\"form-select form-control\" aria-label=\"Default select example\">\r\n<option disabled=\"disabled\" selected=\"selected\">পছন্দ করুন</option>\r\n<option value=\"1\">ক ইউনিট</option>\r\n<option value=\"1\">খ ইউনিট</option